    email: "", pass: "", name: ""
  });


  function Load() {

    axios.get("/get_user_Quiz/" + id)
      .then((res) => {
        console.log(res);
        setInfo({
          arrdata: res.data
        })
      })
      .catch((err) => {
        console.log(err);
      })



    axios.get("/get_specific_user/" + id)

      .then((res) => {
        console.log(res);
        setUser(res.data);

      })
